import React from "react";
import {slide as Menu} from "react-burger-menu";

export default class Sidebar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            // Pass on our props
            <Menu>
                {this.props.userStatus !== 1 ? <a className="menu-item" href="./NavigateTheChief.js">
                        Ana Ekran
                    </a>
                    :

                    <a className="menu-item" href="./PersonelNavigation.js">
                        Ana Ekran
                    </a>
                }

                {
                    this.props.userStatus !== 1 &&
                    <a className="menu-item" href="./PreviousPermissions.js">
                        Personel İzin Talepleri
                    </a>
                }
                <button onClick={()=>{
                    props.history.push({
                        path:'/PersonelScreens/FillingThePermissionForm',
                    })
                }}>

                <a className="menu-item" href={'/PersonelScreens/FillingThePermissionForm'}>
                    İzin Yaratma Ekranı
                </a>
                </button>

                <a className="menu-item" href="./PreviousPermissions.js">
                    İzinlerimi Göster
                </a>
            </Menu>)
    }
}
